import Routes from './Routes';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';

const App = () => {
  return (
    <>
      <Header />
      <Navbar />
      <SideBar />
      <Routes />
    </>
  );
}

export default App;
